def autoincorrect(word):
    """
    Function to replace a word with an autoincorrect version.
    """
    try:
     if word.lower() in autoincorrect_replacements:
        return str(random.choice(autoincorrect_replacements[word.lower()]))
     else:
        return word
    except Exception as e:
     choice = input("an unknown error accoured. would you like to view the message? (Y/N):")
     if(choice.lower == "y"):
       print(e)
     choice2 = input("would you like to retry incorrecting the word?")
     if(choice2.lower() == "y"):
       time.sleep(5)
       if word.lower() in autoincorrect_replacements:
        return str(random.choice(autoincorrect_replacements[word.lower()]))
       else:
        return word
     else:
       return "ERROR"
      

def autoincorrect_sentence(sentence):
    """
    Function to apply autoincorrect to a whole sentence.
    """
    words = sentence.split()
    autoincorrected_words = [autoincorrect(word) for word in words]
    return " ".join(autoincorrected_words)

def asksentence():
    sentence = input("Enter text to autoincorrect: ")
    incorrectsentence = autoincorrect_sentence(sentence)
    print(incorrectsentence)
    asksentence()

